// This is Testimonials component
import styled from "styled-components";

const Section = styled.div`
display: flex;
flex-direction: column;
justify-content: center;
align-items: center;
width: 100%;
padding: 5rem 0;
`;
const Testimonials = () => {
  return <Section>

    <Title>Few good words about us!</Title>
  </Section>;
};

export default Testimonials;
